import React from "react";

export default (props) => {
    let arr = []
    // for (let i = 0; i < props.count; i++) {
    //     arr.push(<td>{}</td>)
    // }
    for (let test in props.rows[0]) {
        arr.push(test)
    }
    console.log(arr)
    return (
        <tbody>
        {props.rows.map((item, index) => {
            return (
                <tr>
                    <td>{item.fio}</td>
                    <td>{item.position}</td>
                    <td>{item.tabNumber}</td>
                </tr>
            )}
        )}
        </tbody>
    )
}
